 import Form from './components/Form';
import Otp from './components/OtpCompo'
import Data from './components/Data';
import {createBrowserRouter , RouterProvider , Outlet  } from "react-router-dom"

function App() {
  return (
    <>
    <Outlet/>
    </>
  );
}

export const appRouter1 = createBrowserRouter([
  {
    path : "/",
    element : <Form/>
  },
  {
    path : "/data",
    element : <Data/>
  },
  {
    path : "/otp",
    element : <Otp/>
  },
])


export default App;
